import { Outlet, Link } from 'react-router-dom';
import styles from "./Nav.module.css"

function Nav() {
  return (
    <div className={styles.nav}>
      <img src={require("../img/logo.png")} alt="" />
      <Link to='/bookkeep/record'>紀錄</Link>
      <span> </span>
      <Link to='/bookkeep/present'>統計圖表</Link>
      <Outlet></Outlet>
    </div>
  );
}

export default Nav;
